import React, { Component } from 'react'
import {Segment, Image, Grid, GridColumn, GridRow} from 'semantic-ui-react'

export default class Home extends Component {
    IMAGES_PATH = './images/';

    DO = '';
    ARE = '';

    render(){
        return(
            <div className = 'tabContent' >

                    <Grid>
                        <GridRow>
                            <GridColumn width={8}>
                                <Segment>
                                    <h2>What we DO:</h2>
                                        <p>
                                            {this.DO}
                                        </p>
                                    <h2>Who we ARE:</h2>
                                        <p>
                                            {this.ARE}
                                        </p>
                                </Segment>
                            </GridColumn>
                            <GridColumn width={8}>
                                 <Segment>
                                    <Image size ='big' centered src={require("" + this.IMAGES_PATH + 'pratt-pretty.jpeg')}/>
                                 </Segment>
                            </GridColumn>
                        </GridRow>
                    </Grid>

            </div>
        )
    }
}
